import React from "react";
import Navbar from "./components/Navbar";
import Catalogo from "./components/Catalogo";
import styles from "./App.module.css";

function App() {
  return (
    <div className={styles.appContainer}>
      <Navbar />
      <Catalogo />
    </div>
  );
}

export default App;
